import style from '../SearchBar/SearchBar.module.css'

export default function SearchBar(props) {
   const {onSearch} = props
   return (
      <div className={Style.navBar}>
         <input type='search' />
         <button onClick={onSearch}>Agregar</button>
      </div>
   );
}
